import { useState } from 'react'
import { Link, redirect, useNavigate } from 'react-router-dom'
import './styles.css'

export const Todo = ({d}) => {

    const navigate = useNavigate()

    navigate(`${d.id}`)



    return(
        <div className="todo" onClick ={ ()=>navigate()}>
            <p>{d.title}</p>
            <button onClick={()=> console.log(d.id)}>X</button>
        </div>

    )
}
